import React from 'react';
import girlCoder from '../../Assets/girlCoder.png';
import me from "../../Assets/beingMe.jpg";


const GirlCoder = () => {
    return (
      <div>
        <img src={girlCoder} className={'me'} alt='beingMe' width='100' height='120' />
      </div>
    );
};

export default GirlCoder;
